import { Provider, useSelector } from "react-redux";
import AppLayout from "../components/AppLayout";

const Home = () => {
  const {isLoggedIn} =useSelector((state)=> state.user)
  return (
    <Provider store={store}>
      <AppLayout>
        <div>
          <PostForm />
          <PostCard />
        </div>
      </AppLayout>
    </Provider>
  );
};

document.getElementById("root");
export default Home;
